import React, { useState } from 'react';
import Navbar from '../navSection/Navbar';
import SearchBar from '../component/SearchBar';
import SearchOutlinedIcon from '@mui/icons-material/SearchOutlined';
import Button from 'react-bootstrap/Button';
import ArrowBackIosIcon from '@mui/icons-material/ArrowBackIos';
import KeyboardArrowRightIcon from '@mui/icons-material/KeyboardArrowRight';
import KeyboardArrowLeftIcon from '@mui/icons-material/KeyboardArrowLeft';


function Product() {
  const [searchOpen, setSearchOpen] = useState(false);

  const handleSearchOpen = () => {
    setSearchOpen(!searchOpen);
  };
  return (
    <div>

    
    <div style={{ position: 'relative' }}>
      <Navbar />
      {!searchOpen && (
        <div className='d-md-none'
          onClick={handleSearchOpen}
          style={{ position: 'absolute', top: 0, left: '60%' }}
        >
          {' '}
          <Button
            variant="success"
            className="bg-success d-flex border btn1"
            style={{ height: '35px' }}
          >
            <SearchOutlinedIcon className="text-white" /> <KeyboardArrowRightIcon />
          </Button>
        </div>
      )}
      <div
        className="my- m-auto d-none d-md-block mdSearchBar"
        style={{ width: '30%', position: 'absolute', top: 0, left: '30%' }}
      >
        <SearchBar />
      </div>
      {searchOpen && (
        <div
          className="d-flex bg-success  d-md-none mobileSearchPosition"
          style={{
            width: '100%',
            height: '100%',
            position: 'absolute',
            top: 0,
            left: 0,
           
          }}
        >
          <SearchBar />
          <Button
            variant="success"
            className="bg-success btn1"
            
            style={{ height: '35px' ,  }}
          >
            <KeyboardArrowLeftIcon onClick={handleSearchOpen}  className="text-white border" />
          </Button>
        </div>
      )}
    </div>
    </div>
  );
}

export default Product;
